void ahdDemosaic(int x, int y) {
    // Indices for neighboring pixels
    int i_1 = x - 1;
    int i_2 = x + 1;
    int i_3 = x - 2;
    int i_4 = x + 2;

    int j_1 = y - 1;
    int j_2 = y + 1;
    int j_3 = y - 2;
    int j_4 = y + 2;
    int H,V;
    float red, blue, green;
    if (x % 2 == 1 && y % 2 == 0){ // Blue Row and Green Pixel
        red = (bayerArray[i_1][y] + bayerArray[i_2][y]) / 2;
        blue = (bayerArray[x][j_1] + bayerArray[x][j_2]) / 2;
        green = bayerArray[x][y];
    }
    if (x % 2 == 1 && y % 2 == 1){ // Blue Row and Blue Pixel
        H = abs((bayerArray[i_3][y] / 2) + (bayerArray[i_4][y] / 2) - bayerArray[x][y]);
        V = abs((bayerArray[x][j_3] / 2) + (bayerArray[x][j_4] / 2) - bayerArray[x][y]);
        if (H >= V){
            green = (bayerArray[x][j_1] + bayerArray[x][j_2])/ 2;
        }
        else if(H < V){
            green = (bayerArray[i_1][y] + bayerArray[i_2][y])/ 2;
        }
        else{
            green = -(bayerArray[x][j_3] / 4) + (bayerArray[x][j_1] / 2) + (bayerArray[x][y] / 2) + (bayerArray[x][j_2] / 2) - (bayerArray[x][j_4] / 4); 
        }
        red = (bayerArray[i_1][j_1] / 4) + (bayerArray[i_1][j_2] / 4) + (bayerArray[i_2][j_1] / 4) + (bayerArray[i_2][j_2] / 4);
        blue = bayerArray[x][y];
    }
    if (x % 2 == 0 && y % 2 == 0){ // Red Row and Red Pixel
        H = abs((bayerArray[i_3][y] / 2) + (bayerArray[i_4][y] / 2) - bayerArray[x][y]);
        V = abs((bayerArray[x][j_3] / 2) + (bayerArray[x][j_4] / 2) - bayerArray[x][y]);
        if (H >= V){
            green = (bayerArray[x][j_1] + bayerArray[x][j_2])/ 2;
        }
        else if(H < V){
            green = (bayerArray[i_1][y] + bayerArray[i_2][y])/ 2;
        }
        else{
            green = -(bayerArray[x][j_3] / 4) + (bayerArray[x][j_1] / 2) + (bayerArray[x][y] / 2) + (bayerArray[x][j_2] / 2) - (bayerArray[x][j_4] / 4); 
        }
        blue = (bayerArray[i_1][j_1] / 4) + (bayerArray[i_1][j_2] / 4) + (bayerArray[i_2][j_1] / 4) + (bayerArray[i_2][j_2] / 4);
        red = bayerArray[x][y];

    }
    if (x % 2 == 0 && y % 2 == 1){ // Red Row and Green Pixel
        red = (bayerArray[x][j_1] + bayerArray[x][j_2]) / 2;
        blue = (bayerArray[i_1][y] + bayerArray[i_2][y]) / 2;
        green = bayerArray[x][y];
    }
    
    // Create and return the demosaiced pixel
    RGB pixel;
    pixel.red = clamp(red);
    pixel.green = clamp(green);
    pixel.blue = clamp(blue);
    int i = x - 2;
    int j = y - 2;
    demosaicArray[i][j] = pixel;
}

